import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Ticket, Calendar, MapPin, Clock } from 'lucide-react';

const MyEvents = ({ theme, events, onCancel }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  const styles = {
    // 1. CONTAINER: Responsive
    container: {
      padding: '3vw',
      fontFamily: "'Inter', sans-serif",
      maxWidth: '60vw', // Restrict on large screens
      width: '90vw',    // Fallback for smaller screens
      margin: '0 auto',
      minHeight: '100vh',
      color: isDark ? '#fff' : '#1e293b'
    },
    header: { marginBottom: '4vh' },
    title: { fontSize: '2.5vw', fontWeight: '800', marginBottom: '1vh' },
    subtitle: { color: '#64748b', fontSize: '1.2vw' },

    // Empty State
    emptyState: {
      display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center',
      padding: '6vh 2vw', textAlign: 'center',
      backgroundColor: isDark ? '#1e293b' : '#f8fafc',
      borderRadius: '2vw', border: isDark ? '1px dashed #334155' : '2px dashed #e2e8f0'
    },
    browseBtn: {
      marginTop: '2vh',
      backgroundColor: '#3b82f6', color: '#fff',
      padding: '1.5vh 2.5vw', borderRadius: '1vw',
      border: 'none', fontWeight: 'bold', cursor: 'pointer',
      fontSize: '1.2vw'
    },

    // Ticket List
    list: { display: 'flex', flexDirection: 'column', gap: '2vh' },
    
    // Ticket Card
    ticketCard: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderRadius: '1.5vw',
      padding: '2vw',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      display: 'flex',
      flexDirection: 'column',
      gap: '2vh',
      boxShadow: '0 0.5vh 1vh rgba(0,0,0,0.02)',
      position: 'relative',
      // Desktop: Row layout
      '@media (min-width: 768px)': {
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between'
      }
    },
    // Left Side
    ticketInfo: { flex: 1 },
    ticketTitle: { fontSize: '1.8vw', fontWeight: 'bold', marginBottom: '1.5vh' },
    metaRow: { display: 'flex', gap: '2vw', flexWrap: 'wrap', color: '#64748b', fontSize: '1vw' },
    metaItem: { display: 'flex', alignItems: 'center', gap: '0.5vw' },
    
    // Status Badge
    badge: (status) => ({
      display: 'inline-block',
      padding: '0.5vh 1vw',
      borderRadius: '2vw',
      fontSize: '0.9vw',
      fontWeight: 'bold',
      marginBottom: '1.5vh',
      backgroundColor: status === 'approved' ? '#dcfce7' : '#fef3c7',
      color: status === 'approved' ? '#15803d' : '#b45309'
    }),

    // Action Buttons
    actions: {
      display: 'flex',
      gap: '1vw',
      marginTop: '1vh',
      minWidth: '15vw' // Ensure buttons have space
    },
    viewBtn: {
      flex: 1,
      padding: '1vh 2vw',
      borderRadius: '0.8vw',
      backgroundColor: '#f1f5f9',
      color: '#0f172a',
      border: 'none',
      fontWeight: '600',
      cursor: 'pointer',
      fontSize: '1vw'
    },
    cancelBtn: {
      flex: 1,
      padding: '1vh 2vw',
      borderRadius: '0.8vw',
      backgroundColor: isDark ? 'transparent' : '#fff',
      color: '#ef4444',
      border: '1px solid #fee2e2',
      fontWeight: '600',
      cursor: 'pointer',
      fontSize: '1vw'
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h1 style={styles.title}>My Tickets</h1>
        <p style={styles.subtitle}>Manage your upcoming events and registrations.</p>
      </div>

      {events.length === 0 ? (
        <div style={styles.emptyState}>
          <Ticket size={64} color="#cbd5e1" strokeWidth={1.5} />
          <h3 style={{ marginTop: '2vh', color: isDark ? '#fff' : '#334155', fontSize: '1.5vw' }}>No tickets yet</h3>
          <p style={{ color: '#94a3b8', fontSize: '1vw' }}>You haven't registered for any events yet.</p>
          <button style={styles.browseBtn} onClick={() => navigate('/events')}>
            Browse Events
          </button>
        </div>
      ) : (
        <div style={styles.list}>
          {events.map(event => (
            <div key={event.id} style={styles.ticketCard}>
              <div style={styles.ticketInfo}>
                <span style={styles.badge(event.status)}>
                  {event.status === 'approved' ? 'Confirmed' : 'Pending Approval'}
                </span>
                <h3 style={styles.ticketTitle}>{event.title}</h3>
                
                <div style={styles.metaRow}>
                  <div style={styles.metaItem}><Calendar size={16} /> {event.date}</div>
                  <div style={styles.metaItem}><MapPin size={16} /> {event.location}</div>
                  <div style={styles.metaItem}><Clock size={16} /> 09:00 AM</div>
                </div>
              </div>

              <div style={styles.actions}>
                {event.status === 'approved' && (
                  <button 
                    style={styles.viewBtn} 
                    onClick={() => navigate(`/ticket-confirmation/${event.id}`)}
                  >
                    View Ticket
                  </button>
                )}
                <button 
                  style={styles.cancelBtn} 
                  onClick={() => onCancel(event.id)}
                >
                  Cancel
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MyEvents;
